import './App.css';
import Card from './components/card';
import { useState } from 'react';


function App() {
  const [isVisible,setIsVisible] = useState("")
  return (
    <div className="App">
      {isVisible?<Card/>:<></>}
      <button onClick={()=>setIsVisible(!isVisible)}>Toggle</button>
    </div>
  );
}

export default App;
